import logo from './logo.svg';
import './App.css';

function App() {
  let [tTtile] = useState(['이수'])
  return (
    <div className="App">

    </div>
  );
}

function tableModal() {
  return(
    <table width={1000} border={1}>
        <thead>
          <tr>
            <th>이수</th>
            <th>필수</th>
            <th>과목명</th>
            <th>학점</th>
            <th>출석점수</th>
            <th>과제점수</th>
            <th>중간고사</th>
            <th>기말고사</th>
            <th>총점</th>
            <th>평균</th>
            <th>성적</th>
          </tr>
        </thead>
        <tbody>
        <tr>
            <td>이수</td>
            <td>필수</td>
            <td>과목명</td>
            <td>학점</td>
            <td>출석점수</td>
            <td>과제점수</td>
            <td>중간고사</td>
            <td>기말고사</td>
            <td>총점</td>
            <td>평균</td>
            <td>성적</td>
          </tr>
        </tbody>
      </table>
  );
}

export default App;
